[{"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "chembl"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "chembl", "sparql_query": "PREFIX cco: <http://rdf.ebi.ac.uk/terms/chembl#>

SELECT DISTINCT ?chemblId ?moleculeLabel ?drugbankId
FROM <http://rdf.ebi.ac.uk/dataset/chembl>
WHERE {
  ?molecule a cco:SmallMolecule ;
            cco:chemblId ?chemblId ;
            rdfs:label ?moleculeLabel ;
            cco:highestDevelopmentPhase 4 ;
            cco:moleculeXref ?drugbankId .
  FILTER(STRSTARTS(STR(?drugbankId), "http://www.drugbank.ca/drugs/"))
}
ORDER BY ?chemblId
LIMIT 1000"}}]

[{"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "
PREFIX up: <http://purl.uniprot.org/core/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT ?protein ?name ?keyword
WHERE {
  ?protein a up:Protein ;
           up:reviewed true ;
           up:classifiedWith ?keyword .
  ?keyword rdfs:label ?keywordLabel .
  FILTER(CONTAINS(LCASE(?keywordLabel), "signal peptide"))
  OPTIONAL { ?protein up:recommendedName/up:fullName ?name }
}
LIMIT 100
"}}, {"name": "mcp__togomcp__get_sparql_example", "input": {"dbname": "uniprot"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "
PREFIX core: <http://purl.uniprot.org/core/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?protein ?proteinName ?mnemonic ?keywordLabel
FROM <http://sparql.uniprot.org/uniprot>
FROM <http://sparql.uniprot.org/keywords>
WHERE {
    ?protein a core:Protein ;
             core:reviewed true ;
             core:mnemonic ?mnemonic ;
             core:classifiedWith ?keyword .
    ?keyword rdfs:label ?keywordLabel .
    FILTER(CONTAINS(LCASE(?keywordLabel), "signal"))
    OPTIONAL {
        ?protein core:recommendedName / core:fullName ?proteinName .
    }
}
LIMIT 100
"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "
PREFIX core: <http://purl.uniprot.org/core/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?protein ?proteinName ?mnemonic ?keywordLabel
FROM <http://sparql.uniprot.org/uniprot>
FROM <http://sparql.uniprot.org/keywords>
WHERE {
    ?protein a core:Protein ;
             core:reviewed true ;
             core:mnemonic ?mnemonic ;
             core:classifiedWith ?keyword .
    ?keyword rdfs:label ?keywordLabel .
    FILTER(?keywordLabel = "Signal")
    OPTIONAL {
        ?protein core:recommendedName / core:fullName ?proteinName .
    }
}
LIMIT 100
"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "
PREFIX core: <http://purl.uniprot.org/core/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?protein ?proteinName ?mnemonic ?keywordLabel
FROM <http://sparql.uniprot.org/uniprot>
FROM <http://sparql.uniprot.org/keywords>
WHERE {
    ?protein a core:Protein ;
             core:reviewed true ;
             core:mnemonic ?mnemonic ;
             core:classifiedWith ?keyword .
    ?keyword rdfs:label ?keywordLabel .
    FILTER(LCASE(?keywordLabel) = "signal peptide")
    OPTIONAL {
        ?protein core:recommendedName / core:fullName ?proteinName .
    }
}
LIMIT 100
"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "
PREFIX core: <http://purl.uniprot.org/core/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?protein ?proteinName ?mnemonic ?comment
FROM <http://sparql.uniprot.org/uniprot>
WHERE {
    ?protein a core:Protein ;
             core:reviewed true ;
             core:mnemonic ?mnemonic ;
             core:annotation ?annotation .
    ?annotation a core:Signal_Peptide_Annotation .
    OPTIONAL {
        ?protein core:recommendedName / core:fullName ?proteinName .
    }
    OPTIONAL {
        ?annotation rdfs:comment ?comment .
    }
}
LIMIT 100
"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "
PREFIX core: <http://purl.uniprot.org/core/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT (COUNT(DISTINCT ?protein) AS ?count)
FROM <http://sparql.uniprot.org/uniprot>
WHERE {
    ?protein a core:Protein ;
             core:reviewed true ;
             core:annotation ?annotation .
    ?annotation a core:Signal_Peptide_Annotation .
}
"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "
PREFIX core: <http://purl.uniprot.org/core/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX taxon: <http://purl.uniprot.org/taxonomy/>

SELECT DISTINCT ?protein ?proteinName ?mnemonic ?organism
FROM <http://sparql.uniprot.org/uniprot>
FROM <http://sparql.uniprot.org/taxonomy>
WHERE {
    ?protein a core:Protein ;
             core:reviewed true ;
             core:mnemonic ?mnemonic ;
             core:organism ?org ;
             core:annotation ?annotation .
    ?annotation a core:Signal_Peptide_Annotation .
    ?org core:scientificName ?organism .
    OPTIONAL {
        ?protein core:recommendedName / core:fullName ?proteinName .
    }
    FILTER(?org IN (taxon:9606, taxon:10090, taxon:7227, taxon:6239, taxon:83333, taxon:559292))
}
LIMIT 50
"}}]
